import Link from 'next/link';
import Header from '../comps/Header';

export default function Index() {
  return (
    <div>
    <Header />
    <p>Hello Next.js</p>
    <Link href="/about" title="About Page">
        <a>About Page</a>
    </Link>
      <p>Hello Next.js</p>
    </div>
  );
}
